import React from "react";
import { useEffect, useState } from "react";
import axios from "axios";
import left from "../img/left.png";
import right from "../img/right.png";

function HomeImg() {
  const [img, setimg] = useState([]);
  const fetchCouses = async () => {
    try {
      const response = await axios.get("http://localhost:3004/homeImg");
      setimg(response.data);
    } catch (error) {
      console.log(error);
    }
  };
  useEffect(() => {
    fetchCouses();
  }, []);
  return (
    <div>
      <div className=" relative w-full h-[675px] bg-gray-400">
        <div className=" w-full h-[675px] flex">
          <div className=" w-12">
            <img src={left} alt="" />
          </div>
          <div>
            <div></div>
            <div></div>
          </div>
          <div>
            <img className=" w-12" src={right} alt="" />
          </div>
        </div>
      </div>
    </div>
  );
}

export default HomeImg;
